    createLayer : function(servicePath,executorType,
        layerName,bbox,tileWidth,tileHeight){
        if(!layerName){
            layerName : "default";
        }
        if(!bbox){
            bbox = null;
        }
        if(!tileWidth){
            tileWidth = 256;
        }
        if(!tileHeight){
            tileHeight = 256;
        }
        var layer = new OriginalLayer(servicePath,executorType,
            layerName,bbox,tileWidth,tileHeight);
        return layer;
    },
    calculateBBox : function(points){
        var maxLng = Number.MIN_VALUE;
        var maxLat = Number.MIN_VALUE;
        var minLng = Number.MAX_VALUE;
        var minLat = Number.MAX_VALUE;
        for(var geo in points){
            maxLng = Math.max(maxLng,geo.longitude);
            maxLat = Math.max(maxLat,geo.latitude);
            minLng = Math.min(minLng,geo.longitude);
            minLat = Math.min(minLat,geo.latitude);
        }
        return new GridBbox(minLat,minLng,maxLat,maxLng);
    },
    getAppropriateZoomLevel : function(bbox,map){
        var upLeft = new twaver.gis.geometry.GeoCoordinate(bbox.maxLat,bbox.minLng);
        var bottomRight  = new twaver.gis.geometry.GeoCoordinate(bbox.minLat,bbox.maxLng);	
        var levels = map._levels;
        if(!levels){
        	levels = [];
        	for(var index=map.zoomLowLimit;index<=map.zoomUpLimit;index++){
        		levels.push(index);
        	}
        }		
        for(var i = 0;i<=levels.length;i++){
        	var z = levels[i];
            var upLeftPixel  = getPixelXYFromGeoPoint(upLeft,z, map.projectionType);
            var bottomRightPixel = getPixelXYFromGeoPoint(bottomRight, z, map.projectionType);
            var w = Math.abs(bottomRightPixel.x - upLeftPixel.x);
            var h = Math.abs(bottomRightPixel.y - upLeftPixel.y);
            if((w>map.viewport.width)||(h>map.viewport.height)){
                return levels[i-1];
            }
        }
        return levels[levels.length-1];
    },
    getGeoPointFromPixelXY : function(pixelx,pixely,
        zoomLevel,projectionType,tileWidth,tileHeight){
        if(!tileWidth)
            tileWidth = 256;
    
        if(!tileHeight){
            tileHeight = 256;
        }
        return getGeoPointFromPixelXY(pixelx,pixely,zoomLevel,projectionType,tileWidth,tileHeight);
    },
    DEFAULT_GEOCOORDINATE_INVALIDATE_FUNCTION : function(geo){
        return ((Math.abs(geo.latitude)<=90)&&(Math.abs(geo.longitude)<=180));
    },
    distance:function(source,target){
        var px = target.x - source.x;
        var py = target.y - source.y;
        return Math.sqrt(px * px + py * py);
    },
    isIllegal:function(source, reference,distanceTolerance) {
        return (GISUtils.distance(reference,source) > distanceTolerance);
    },
    getLegalDistanceToLeranceOfTileMap:function(map) {
        var zoom = map.getZoomLevel();
        var array = GISUtils.getGlobalSetting(GISSettings.OPTIMIZE_GEOMETRY_DISTANCE);
        return array[zoom];
    }
